import React, {useState} from "react";
import "./consultationrequest.css";

const ConsultationRequest = () => {
  const [option, setOption] = useState("");
  return (
    <div className="container border text-center">
      <div className="form-holder border m-auto">
        <h5>Request a free consultation</h5>
        <form>
          <p>What type of consultation would you like?</p>
          <label>
            <input
              type="radio"
              value="option1"
              checked={option === "option1"}
              onChange={() => setOption("option1")}
            />
            Option 1
          </label>
          <label>
            <input
              type="radio"
              value="option2"
              checked={option === "option2"}
              onChange={() => setOption("option2")}
            />
            Option 2
          </label>
        </form>
      </div>
    </div>
  );
};

export default ConsultationRequest;
